import React from 'react';
import './App.css';

const Board = () => {
  const renderSquare = (isBlack, key) => {
    const color = isBlack ? 'black' : 'white';
    return <div key={key} className={`square ${color}`}></div>;
  };

  const renderRow = (rowIndex) => {
    const squares = [];
    for (let i = 0; i < 8; i++) {
      squares.push(renderSquare((rowIndex + i) % 2 !== 0, i));
    }
    return <div key={rowIndex} className="board-row">{squares}</div>;
  };

  const renderBoard = () => {
    const rows = [];
    for (let i = 0; i < 8; i++) {
      rows.push(renderRow(i));
    }
    return <div className="board">{rows}</div>;
  };

  return <div className="board-container">{renderBoard()}</div>;
};

const App = () => {
  return (
    <div className="App">
      <Board />
    </div>
  );
};

export default App;
